import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function App() {
  console.log('App component rendering...');

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Valkyrie Cardano Wallet</Text>
      <Text style={styles.subtitle}>Advanced Cardano Wallet</Text>
      <Text style={styles.description}>
        One-touch payments, mnemonic encryption, offline transactions
      </Text>
      <View style={styles.buttonContainer}>
        <Text style={styles.button}>Create Wallet</Text>
        <Text style={styles.button}>Restore Wallet</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#0a0a0a',
    padding: 20,
  },
  title: {
    fontSize: 32,
    fontWeight: 'bold',
    color: '#00ff88',
    textAlign: 'center',
    marginBottom: 10,
  },
  subtitle: {
    fontSize: 18,
    color: '#00ccff',
    textAlign: 'center',
    marginBottom: 20,
  },
  description: {
    fontSize: 16,
    color: '#ffffff',
    textAlign: 'center',
    marginBottom: 40,
    lineHeight: 24,
  },
  buttonContainer: {
    flexDirection: 'row',
    gap: 20,
  },
  button: {
    fontSize: 18,
    color: '#00ff88',
    backgroundColor: '#1a1a1a',
    padding: 15,
    borderRadius: 8,
    borderWidth: 2,
    borderColor: '#00ff88',
  },
});
